import React from 'react';
import styled from 'styled-components';

function ProfileLevel3(props) {
	return (
		<ComponentWrapper>
			<div className="MatchUpForm Form_className__zPqfI MainResume_className__uaaBn">
				<header className="Form-header">
					<dl className="Form-title">
						<dt>기본 이력서</dt>
					</dl>
				</header>
				<div className="FormBlock Block_className__Y0A0N">
					<div className="FormBlock-content content">
						<div className="Static_className__HvTft">
							<div className="Static-label">기본 이력서 선택</div>
							<div className="Static-body">
								<div className="DefaultResumeSelector_className__Fo4dm">
									<button
										type="button"
										className="DefaultResumeSelector-button"
									>
										<div className="ResumeLang_container__qljkJ DefaultResumeSelector-resumeLang">
											한
										</div>
										<span>이해찬 1</span>
									</button>
								</div>
							</div>
						</div>
						<div className="MainResume-fieldset">
							<div className="Static_className__HvTft">
								<div className="Static-label">학교</div>
								<div className="Static-body">
									<div className="ResumeEntry_className__6yI3Y">
										<span className="ResumeEntry-major">
											ㅁㄴ
										</span>
										<span className="ResumeEntry-minor is-empty">
											전공 미입력
										</span>
									</div>
								</div>
							</div>
							<div className="Static_className__HvTft">
								<div className="Static-label">직장</div>
								<div className="Static-body">
									<div className="ResumeEntry_className__6yI3Y">
										<span className="ResumeEntry-major">
											ㅁㄴㅇ
										</span>
										<span className="ResumeEntry-minor is-empty">
											직책 미입력
										</span>
									</div>
								</div>
							</div>
							<a
								href="/cv/BgAKCw8GAE4HBA0DBwsKSkU=?from=profile"
								className="MainResume-edit"
								aria-label=""
								data-attribute-id="profile__completeProfile"
							>
								<i
									className="icon-edit"
									style={{ fontSize: '28px' }}
								/>
							</a>
						</div>
						<div className="MainResume-about">
							안녕하세요. 신입 웹 개발자입니다.
						</div>
					</div>
				</div>
